patchedCode:
    @ -------------------------------------------
    @  > 512MB (OOB Area)
    @ 0x100000 sectors * 512 bytes = 512MB
    @ -------------------------------------------
    mov     r12, #0x100000
    cmp     r0, r12
    bcs     handle_oob_access   @ >= 512MB OOB

    @ -------------------------------------------
    @  > 256MB (Main Area)
    @ 0x80000 sectors * 512 bytes = 256MB
    @ -------------------------------------------
    mov     r12, #0x80000
    cmp     r0, r12
    bcc     doOrigin            @ < 256MB 

    @ -------------------------------------------
    @ Main Area Access (Existing Logic)
    @ -------------------------------------------
    sub     r0, r0, r12         @ 256MBLBA
    mov     r3, r2              @  NandBatchRead ( Arg2=Count)
    mov     r2, r1              @  NandBatchRead ( Arg1=Buffer)
    
    @  LBA   (LBA << 9) 
    @ S3C2416 Bootloader64
    mov     r1, r0, lsr #23     @ High Address
    mov     r0, r0, lsl #9      @ Low Address
    b       NandBatchRead       @ Main

doOrigin:
    PUSH    {R4-R8, LR}
    b       originCode          @ 

@ =========================================================
@ OOB 
@ NANDSpare Area
@ =========================================================
handle_oob_access:
    PUSH    {R4-R9, LR}         @ 
    
    @  Page Index
    @ LBA = LBA - 0x100000
    sub     r0, r0, r12
    
    @ 512B Sector  8PageOOB (8 * 64 = 512)
    @ StartPage = RelLBA * 8
    mov     r0, r0, lsl #3      @ R0  Page Index
    
    @  NAND  (0x4E000000)
    ldr     r3, =0x4E000000

sector_loop:
    cmp     r2, #0              @  (Count)
    beq     oob_done
    
    mov     r4, #8              @ 8PageSector

page_loop:
    @ 1.  (NFCONT[1] = 0)
    ldr     r5, [r3, #4]        @  NFCONT
    bic     r5, r5, #2          @  bit 1 (nFCE)
    str     r5, [r3, #4]

    @ 2.  Read  (0x00)
    mov     r5, #0x00
    strb    r5, [r3, #8]        @ NFCMMD

    @ 3.  Column Address (2 Cycles)
    @  2048 (0x800)  OOB
    strb    r5, [r3, #0xC]      @ NFADDR Col Low = 0x00
    mov     r5, #0x08
    strb    r5, [r3, #0xC]      @ NFADDR Col High = 0x08

    @ 4.  Row/Page Address (3 Cycles)
    @ 256MB (2Gb) Flash  3 Row Cycle
    strb    r0, [r3, #0xC]      @ Row Cycle 1 (A0-A7)
    mov     r5, r0, lsr #8
    strb    r5, [r3, #0xC]      @ Row Cycle 2 (A8-A15)
    mov     r5, r0, lsr #16
    strb    r5, [r3, #0xC]      @ Row Cycle 3 (A16-A24)

    @ 5.  Read Confirm  (0x30)
    mov     r5, #0x30
    strb    r5, [r3, #8]        @ NFCMMD

    @ 6.  R/nB (NFSTAT[0])
wait_ready:
    ldr     r5, [r3, #0x28]     @ NFSTAT
    tst     r5, #1              @  bit 0
    beq     wait_ready          @ 0 (Busy) 

    @ 7.  64  OOB 
    @ S3C2416 NFDATA Word (4)
    @ 64 bytes = 16 words
    mov     r5, #16
read_fifo_loop:
    ldr     r6, [r3, #0x10]     @  NFDATA
    str     r6, [r1], #4        @ Buffer, R1+4
    subs    r5, r5, #1
    bne     read_fifo_loop

    @ 8.  (NFCONT[1] = 1)
    ldr     r5, [r3, #4]
    orr     r5, r5, #2
    str     r5, [r3, #4]

    @ 
    add     r0, r0, #1          @  Page
    subs    r4, r4, #1          @  Page 
    bne     page_loop           @ PageOOB

    sub     r2, r2, #1          @  Sector 
    b       sector_loop         @ Sector

